description.narrative:
The Commonwealth Blue Charter is intended to be an action-oriented implementation vehicle by which Commonwealth countries can cooperate towards attainment of the myriad of ocean-related commitments that they face, with particular focus on the UN Sustainable Development Goals (SDGs), especially SDG 14 (ocean). 

Priorities and actions will be member-driven, facilitated by the Commonwealth Secretariat, and led by Commonwealth Blue Charter (CBC) Champion countries. 

Commonwealth member countries are invited to (co-) lead a Commonwealth Blue Charter community of practice on a topic of particular interest to them.  These communities of practice, known here as Action Groups, will be the means by which the Commonwealth Blue Charter will be realised. The possible topic areas are open to member country suggestions, so long as they relate to an ocean-related issue with broad potential application in the Commonwealth (and beyond). Ideally, Action Group topics will tie into an SDG, though this is not strictly necessary.  

The Commonwealth Secretariat will assist the Champion countries with:
coordinating membership of the Action Group ;
developing terms of reference, to be reviewed and approved by the Action Group membership;
developing plans of action with the Action Group membership;
making available subject matter experts and practitioners;
co-organising Action Group meetings, at least one per year, to be held in one of the Action Group countries;
reporting on progress (MEL).
Note: The emergence of the Covid-19 pandemic has altered some of the implentation plans described above (especially holding in-person Action Group meetings). All in-person meetings, workshops and capacity building planned for the first half of 2020 had been postponed; including four Action Group meetings as well as the annual ‘All-Champions’ meeting, scheduled for March 2020 in Cyprus. Similarly, the in-person segments of CHOGM, UN Oceans, Our Oceans, UNFCCC COP26 and other international events where Blue Charter side events and meetings were planned have also been postponed. We are currently scheduling various virtual engagements to replace in-person meetings.
